import React, { Component } from 'react';
import './App.css';


function h1_message(props) {
  return (
    <h1>{props.message}</h1>
  )
}

class App extends Component {
  render() {
    return (
      <div className="App">
        <Header message='BusPoa transporte' />
      </div>
    );
  }
}

export default App;
